import logo from "./logo.svg";
import "./App.css";
import Home from "./homeComponent";
import NavbarComponent from "./navbarComponent";

import "bootstrap/dist/css/bootstrap.css";
import ContentColumn2 from "./contentColumn";
import FooterComponent from "./footerComponent";

const ScheduleCompoonent = () => {
  return (
    <div>
      <NavbarComponent />
      <div></div>
      <p className="long">How often do you want your waste to be picked up?</p>
      <div className="duration">
        <button type="buttn" className="btn5">Click Me!</button>
        <button type="button" className="btn5"> Click Me!</button>
      </div>

      <ContentColumn2 />
      <FooterComponent />
    </div>
  );
};

export default ScheduleCompoonent;
